 Mailing list name\",\"Escriba un nombre unico para la lista de correo\"],[\"Success signup URL\",\"URL de \\u00c9xito con registro \"],[\"User will be redirected to this url in case he will confirm his registration in Mailing list. It is used in case Double Optin mechanism is used. If not defined, default message is displayed without redirection.\",\"El usuario ser\\u00e1 redirigido a este url en caso de que se confirmara su inscripci\\u00f3n en la lista de correo. Se utiliza en caso que el mecanismo de Doble Entrada se utiliza. Si no se define, el mensaje por defecto se muestra sin redirecci\\u00f3n.\"],[\"Double Opt-In\",\"Doble entrada\"],[\"Subscription to mailing list has to be confirmed by user. This is usually done by responding to a confirmation email sent to the email address in subsription request. This eliminates the chance of abuse where somebody submits somebody else's email address without their knowledge and against their will.\",\"suscripci\\u00f3n a la lista de correo tiene que ser confirmado por el usuario. Esto se hace generalmente al responder a un correo electr\\u00f3nico de confirmaci\\u00f3n enviado a la direcci\\u00f3n de correo electr\\u00f3nico en la solicitud de subsription. Esto elimina la posibilidad de abuso cuando alguien afirma de otra persona direcci\\u00f3n de correo electr\\u00f3nico sin su conocimiento y contra su voluntad.\"],[\"Newsletters\",\"Newsletters\"],[\"Here you can find list of your Mailing Lists. You can manage listings by editing existing or adding new Newsletter.\",\"Aqu\\u00ed puedes encontrar la lista de tus listas de correo. Puede administrar listados editando existentes o a\\u00f1adir nuevos boletines.\"],[\"Add new Mailing list\",\"A\\u00f1adir nueva lista de correo\"],[\"Other\",\"Otro\"],[\"For changes to take effect restart of application is needed. Do you want to restart now?\",\"Para que los cambios surtan efecto, reinicie la aplicaci\\u00f3n que se necesita. \\u00bfDesea reiniciar ahora?\"],[\"Undefined\"